            "schema": {
              "type": "string"
            }
          },
          {
            "name": "types",
            "in": "query",
            "schema": {
              "type": "string"
            },
            "example": "[type1],[typeN]"
          }
        ],
        "responses": {
          "200": {
            "description": "Mapping between BrowserSessionStateIds and Arrays of ArtifactIds \n\n ( BrowserSessionStateId &rightarrow; [ ArtifactIds ] )"
          }
        },
        "security": [
          {
            "webmate.user": []
          },
          {
            "apiKey": []
          }
        ]
      }
    },
